window.bookSummaryJSON = "<p><b>I can't see the shadows that lurk in the dark.</b></p> <p>It was supposed to be my first summer on my own, but then I meet Seth, Axel, Jasper, and Cody.</p> <p>There's something about them that drew me closer, and they seemed hell-bent on protecting me. I didn't think I needed protecting until people started showing up dead in the woods.</p> <p>So much for a quiet summer....</p> <p>Can I escape the shadows, or will the darkness consume me?</p> <p><i>Shrouded in the Dark</i> is a stand-alone shifter paranormal reverse-harem novel with 140,000+ words that includes M/M.</p>"; 
